import React from "react";

import '../stylesheet/componentes/titles.css'

function Titles ({titulo}){
    return (
        <div className="titles-div">
            <div className="container-titles">
                <h3>{titulo}</h3>
            </div>
        </div>
    )
}

export default Titles
